Below is a clean LaTeX rendition of your worksheet, with very light edits to fix obvious OCR artifacts (e.g., \(98^2\) vs “982”, \(5000^2\) vs “50002”, \(39^2\) vs “392”), standardize notation, and improve readability. I’ve preserved the original structure, problems, and the provided worked steps/answers (including their occasional quirks).  
Small note: Part 2, Q4(d) in the original asks for the “positive value” of \(a^2-b^2\), but the answer key lists \(-120\). Mathematically, \(|a^2-b^2|=120\) and the sign depends on the ordering of \(a,b\); the positive value is \(+120\).

