\documentclass[12pt,a4paper]{article}

\usepackage{amsmath,amssymb,amsthm}
\usepackage{enumitem}
\usepackage[margin=1in]{geometry}
\usepackage{lmodern}
\usepackage[T1]{fontenc}
\usepackage{microtype}

\setlist[enumerate,1]{label=\arabic*), leftmargin=*, itemsep=0.4em}
\setlist[enumerate,2]{label=\alph*), leftmargin=2em, itemsep=0.2em}

\title{\vspace{-1.5em}Sec 2 Algebra Revision Practice\\[0.2em]
\large (Expansion, Factorization and Identities)\vspace{-0.5em}}
\date{}
\author{}

\begin{document}
\maketitle

\section*{Part 1}

\begin{enumerate}
  \item Expand and simplify each of the following:
  \begin{enumerate}
    \item $5x^{2} - (2x - 1)(x + 1)$
    \item $4x(2x - 1) - 8(x - 1)(x + 1)$
    \item $8x^{2} + 1 - (3x - 2)^{2}$
  \end{enumerate}

  \item Factorize each of the following fully.
  \begin{enumerate}
    \item $6x^{2} + 22x - 40$
    \item $9x^{2} + 6xy + y^{2}$
    \item $25m^{2} - 4n^{2}$
    \item $3x^{2} - 48$
    \item $x^{2} - 9x$
    \item $\pi r^{2} + 2\pi r h$
    \item $3xp - 6xq - 2py + 4qy$
    \item $mq - nq + n - m$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item Given $a^{2} + b^{2} = 43$ and $6ab = 72$, find the value of $(3a + 3b)^{2}$.
    \item Given $(a - b)^{2} = 24$ and $ab = 5$, find the value of $2a^{2} + 2b^{2}$.
    \item Given $a - b = 4$ and $a^{2} + b^{2} = 26$, find the value of $ab$.
    \item Given $x^{2} - y^{2} = 45$ and $x - y = 3$, find the value of $(x + y)^{2}$.
  \end{enumerate}

  \item Using algebraic identities, evaluate:
  \begin{enumerate}
    \item $98^{2}$
    \item $1005^{2}$
    \item $295 \times 305$
    \item $86^{2} - 14^{2}$
    \item $92^{2} - 368 + 4$
    \item $5000^{2} - 5005 \times 4995$
  \end{enumerate}

  \item Expand and simplify:
  \begin{enumerate}
    \item $(2a + 1)^{3}$
    \item $2x - 5(2x - 12)$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item Simplify $x^{2} - (x + a)(x - a)$.
    \item Hence, evaluate $1234^{2} - 1238 \times 1230$.
  \end{enumerate}

  \item
  \begin{enumerate}
    \item Factorize $2x^{2} - 7x + 3$.
    \item Hence, factorize $2(x - 5)^{2} - 7(x - 5) + 3$.
  \end{enumerate}

  \item Factorize each of the following fully.
  \begin{enumerate}
    \item $\dfrac{3x^{2}}{4} + \dfrac{8xy}{4}$
    \item $16x^{4} - 1$
    \item $x^{3} - 3x^{2} - 10x$
    \item $\dfrac{1}{4}x^{2} - (y - 2)^{2}$
  \end{enumerate}

  \item Factorize each of the following fully.
  \begin{enumerate}
    \item $(x - y)^{2} - 3x + 3y$
    \item $4p^{2} - 4a^{2} - 4ab - b^{2}$
  \end{enumerate}
\end{enumerate}

\section*{Part 1: Answers}

\begin{enumerate}
  \item
  \begin{enumerate}
    \item $3x^{2} - x + 1$
    \item $-4x + 8$
    \item $-x^{2} + 12x - 3$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $2(3x - 4)(x + 5)$
    \item $(3x + y)^{2}$
    \item $(5m - 2n)(5m + 2n)$
    \item $3(x + 4)(x - 4)$
    \item $x(x - 9)$
    \item $\pi r(r + 2h)$
    \item $(p - 2q)(3x - 2y)$
    \item $(m - n)(q - 1)$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $603$
    \item $68$
    \item $5$
    \item $225$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item
    \begin{align*}
      98^{2} &= (100 - 2)^{2} = 100^{2} - 2(100)(2) + 2^{2} = 10000 - 400 + 4 = 9604.
    \end{align*}
    \item
    \begin{align*}
      1005^{2} &= (1000 + 5)^{2} = 1000^{2} + 2(1000)(5) + 5^{2} = 1000000 + 10000 + 25 = 1010025.
    \end{align*}
    \item
    \begin{align*}
      295 \times 305 &= (300 - 5)(300 + 5) = 300^{2} - 5^{2} = 90000 - 25 = 89975.
    \end{align*}
    \item
    \begin{align*}
      86^{2} - 14^{2} &= (86 - 14)(86 + 14) = 72 \times 100 = 7200.
    \end{align*}
    \item
    \begin{align*}
      92^{2} - 368 + 4 &= 92^{2} - 2(92)(2) + 2^{2} = (92 - 2)^{2} = 90^{2} = 8100.
    \end{align*}
    \item
    \begin{align*}
      5000^{2} - 5005 \times 4995
      &= 5000^{2} - \bigl[(5000 + 5)(5000 - 5)\bigr]\\
      &= 5000^{2} - \bigl[5000^{2} - 5^{2}\bigr]
      = 25.
    \end{align*}
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $8a^{3} + 12a^{2} + 6a + 1$
    \item $-8x + 60$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $a^{2}$
    \item $16$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $(x - 3)(2x - 1)$
    \item $(x - 8)(2x - 11)$ \quad (via $u = x - 5$)
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $\dfrac{1}{4}x(3x + 8y)$
    \item $(4x^{2} + 1)(2x + 1)(2x - 1)$
    \item $x(x - 5)(x + 2)$
    \item $\Bigl(\dfrac{1}{2}x + y - 2\Bigr)\Bigl(\dfrac{1}{2}x - y + 2\Bigr)$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $(x - y)(x - y - 3)$
    \item $(2p - 2a - b)(2p + 2a + b)$
  \end{enumerate}
\end{enumerate}

\bigskip

\section*{Part 2}

\begin{enumerate}
  \item Factorize each of the following fully.
  \begin{enumerate}
    \item $x^{2} - 3x + 9y - 3xy$
    \item $9p^{2} - \dfrac{1}{16}$
    \item $8x^{2} - 26x + 6$
    \item $4x^{2} - 9x$
    \item $4x^{2} + 12x + 9$
    \item $1 - 25x^{2}y^{2}$
    \item $3x - 6 + xy - 2y$
  \end{enumerate}

  \item Expand and simplify each of the following:
  \begin{enumerate}
    \item $(2x + 3y)^{2} - (2x + y)(2x - y)$
    \item $5y^{2} - (2x - 3y)(-3y)$
    \item $11x - (5x - 2)^{2} + 7$
    \item $\left(3x + \dfrac{1}{2}\right)^{2}$
  \end{enumerate}

  \item Use algebraic identities to evaluate each of the following:
  \begin{enumerate}
    \item $9.7^{2} - 0.3^{2}$
    \item $99^{2}$
    \item $201 \times 199$
    \item $102^{2}$
    \item $39^{2} + 78 + 1$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item Given $x + y = 19$ and $x - y = 17$, find the value of $\dfrac{1}{2}x^{2} - \dfrac{1}{2}y^{2}$.
    \item Given $x^{2} + y^{2} = 74$ and $xy = 35$, calculate the value of $(2x - 2y)^{2}$.
    \item Given $(x + y)^{2} = 36$ and $xy = 8$, find the value of $(4x - 4y)^{2}$.
    \item Given $a^{2} + b^{2} = 218$ and $ab = -91$, find the value of $a^{2} - b^{2}$.
  \end{enumerate}

  \item Expand and simplify $(2x - 3 + y)^{2}$.

  \item
  \begin{enumerate}
    \item Simplify $(x^{2} - 9) - (x - 3)^{2}$.
    \item Hence, evaluate $(2013^{2} - 9) - (2010)^{2}$.
  \end{enumerate}

  \item
  \begin{enumerate}
    \item Factorize $4x^{2} - 4x + 1$.
    \item Using your answer in (a), factorize completely $25 - (1 - 4x + 4x^{2})$.
  \end{enumerate}

  \item Factorize each of the following fully.
  \begin{enumerate}
    \item $a^{2} - b^{2} - 2a + 2b$
    \item $4p^{2} - (a + b)^{2}$
    \item $y^{4} - 16$
  \end{enumerate}

  \item Given that $y + \dfrac{1}{y} = 3$. Find the value of $y^{2} + \dfrac{1}{y^{2}}$.
\end{enumerate}

\section*{Part 2: Answers}

\begin{enumerate}
  \item
  \begin{enumerate}
    \item $(x - 3)(x - 3y)$
    \item $\bigl(3p - \tfrac{1}{4}\bigr)\bigl(3p + \tfrac{1}{4}\bigr)$
    \item $2(4x - 1)(x - 3)$
    \item $x(4x - 9)$
    \item $(2x + 3)^{2}$
    \item $(1 - 5xy)(1 + 5xy)$
    \item $(3 + y)(x - 2)$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $12xy + 10y^{2}$
    \item $-4y^{2} + 6xy$
    \item $-25x^{2} + 31x + 3$
    \item $9x^{2} + 3x + \dfrac{1}{4}$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $(9.7 + 0.3)(9.7 - 0.3) = 10 \times 9.4 = 94$
    \item $(100 - 1)^{2} = 100^{2} - 2(100)(1) + 1^{2} = 9801$
    \item $(200 + 1)(200 - 1) = 200^{2} - 1^{2} = 39999$
    \item $(100 + 2)^{2} = 100^{2} + 2(100)(2) + 2^{2} = 10404$
    \item $39^{2} + 2(39)(1) + 1^{2} = (39 + 1)^{2} = 1600$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $\dfrac{323}{2}$\quad(= $161\dfrac{1}{2}$)
    \item $16$
    \item $64$
    \item $-120$\footnote{The ``positive value'' would be $+120$ since $|(a-b)(a+b)|=|a^2-b^2|=120$.}
  \end{enumerate}

  \item $4x^{2} - 12x - 6y + 4xy + y^{2} + 9$

  \item
  \begin{enumerate}
    \item $6(x - 3)$
    \item $6(2013 - 3) = 6 \cdot 2010 = 12060$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $(2x - 1)^{2}$
    \item $4(x + 2)(3 - x)$
  \end{enumerate}

  \item
  \begin{enumerate}
    \item $(a - b)(a + b - 2)$
    \item $(2p + a + b)(2p - a - b)$
    \item $(y^{2} + 4)(y + 2)(y - 2)$
  \end{enumerate}

  \item $7$\quad (since $(y + \tfrac{1}{y})^{2} = y^{2} + \tfrac{1}{y^{2}} + 2 = 9$)
\end{enumerate}

\end{document}
